import '/Users/prasitpaisan/Desktop/React/port/prasit/src/component/js/navbar.jsx'

document.addEventListener("DOMContentLoaded", function() {
    const navbarToggle = document.getElementById("navbarToggle");
    const navbarMenu = document.getElementById("navbarMenu");

    navbarToggle.addEventListener("click", function() {
        navbarMenu.classList.toggle("active");
    });
});


const Navbar =()=>{
    return(
        <>
            <nav class="navbar">
        <div class="navbar-brand">
            <a href="#">Brand</a>
        </div>
        <div class="navbar-toggle" id="navbarToggle">
            <span class="bar"></span>
            <span class="bar"></span>
            <span class="bar"></span>
        </div>
        <ul class="navbar-menu" id="navbarMenu">
            <li class="navbar-item"><a href="#">Home</a></li>
            <li class="navbar-item"><a href="#">About</a></li>
            <li class="navbar-item"><a href="#">Services</a></li>
            <li class="navbar-item dropdown">
                <a href="#" class="dropdown-toggle">More</a>
                <ul class="dropdown-menu">
                    <li class="dropdown-item"><a href="#">Submenu 1</a></li>
                    <li class="dropdown-item"><a href="#">Submenu 2</a></li>
                    <li class="dropdown-item"><a href="#">Submenu 3</a></li>
                </ul>
            </li>
            <li class="navbar-item"><a href="#">Contact</a></li>
        </ul>
    </nav>
        </>
    );
}

export default Navbar;
